CREATE PROC UPDATEEndDay
AS
UPDATE MembershipsOrders
SET EndDay= DATEADD(day, 365, StartDay)
WHERE Id_Membership=1
UPDATE MembershipsOrders
SET EndDay= DATEADD(day, 182, StartDay)
WHERE Id_Membership=2
UPDATE MembershipsOrders
SET EndDay= DATEADD(day, 30, StartDay)
WHERE Id_Membership=3
UPDATE MembershipsOrders
SET EndDay= DATEADD(day, 1, StartDay)
WHERE Id_Membership IN (4,5);

EXEC UPDATEEndDay




